    public static int subarrayBitwiseORs(int[] A) {
        Set<Integer> set = new HashSet<>();
        for (int i = 1; i <= A.length; i++) {
            for (int j = 0; j <= A.length - i; j++) {
                int res = 0;
                for (int k = j; k < j + i; k++) {
                    res |= A[k];
                }
                set.add(res);
            }
        }
        return set.size();
    }

