    public static int subarrayBitwiseORs2(int[] A) {
        Set<Integer> set = new HashSet<>();
        for (int i = 0; i < A.length; i++) {
            int res = 0;
            for (int j = i; j < A.length; j++) {
                res |= A[j];
                set.add(res);
            }
        }
        return set.size();
    }

